import "../styles/globals.css";
import "bootstrap/dist/css/bootstrap.css";
import Layout from "../components/layout";

class MyApp extends React.Component({ Component, pageProps }) {
  constructor(props) {
    super(props);

    this.state = {
      modalState: true,
    };

    render();
    return (
      <Layout className="layout">
        <Component {...pageProps} />
      </Layout>
    );
  }
}

export default MyApp;
